  [],\n\t\"revision_timestamp\": \"2015-05-07T02:34:01.324911\",\n\t\"name\": \"airs-cloudsat-cloud-mask-and-radar-reflectivities-collocation-indexes-v3-1\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This is AIRS-AMSU-CloudSat collocation indexes,
  in ASCII format. These data map CloudSat profile indexes to the collocated AMSU
  field of views, and AIRS IR footprints, per AIRS 6-min granule time. Hence it can
  be considered as Level 1. These data are created within the frames of the MEaSUREs
  project.nnThe basic task is to bring together retrievals of water vapor and cloud
  properties from multiple \"A-train\" instruments (AIRS, AMSR-E, MODIS, AMSU, MLS,
  & CloudSat), classify each \"scene\" (instrument look) using the cloud information,
  and develop a merged, multi-sensor climatology of atmospheric water vapor as a function
  of altitude, stratified by the cloud classes. This is a large science analysis project
  that will require the use of SciFlo technologies to discover and organize all of
  the datasets, move and cache datasets as required, find space/time \"matchups\"
  between pairs of instruments, and process years of satellite data to produce the
  climate data records.nnThe short name for this collections is AIRS_CPR_IND.\",\n\t\"license_title\":
